type Object struct {
	name     string
	children []*Object
	parent   *Object
	visited  bool
}

func buildOrbitMap(steps *int, currentObject *Object, previousObject *Object) {
	currentObject.parent = previousObject
	for _, nextObject := range currentObject.children {
		*steps++
		buildOrbitMap(steps, nextObject, currentObject)
	}
}

func travelToObject(targetObject string, steps int, iterations *int, travel *bool, currentObject *Object) {

	if *travel {
		*iterations++
		currentObject.visited = true
		if currentObject.name == targetObject {
			fmt.Println("FOUND", steps, currentObject.name)
			*travel = false
			return
		}
		steps++
		fmt.Println(steps, currentObject.name)
		for _, nextObject := range currentObject.children {
			if nextObject.visited == false {
				travelToObject(targetObject, steps, iterations, travel, nextObject)
			}
		}
		if currentObject.parent != nil && currentObject.parent.visited == false {
			travelToObject(targetObject, steps, iterations, travel, currentObject.parent)
		}

	}
}
